function traverseTree($tree, $hist, $level=1){
	global $runcount;
	foreach ($tree as $key => $val){
		$envName = $val['id'];
		$envVal = $val['lyrics'];
		putenv("$envName=$envVal"); // Add the environment variable
		
		if (!array_key_exists('children',$val)){
			// Leaf Node, do stuffs
			if ($level < 5) continue; // not complete
			$newhist = $hist;
			$newhist[] = array($val['id'], $val['lyrics']);
				
			echo $runcount."\n";
			$runcount++;
			//if ($runcount <540) continue; // speed up manual testing
			/*
			for ($i=0; $i<count($newhist); $i++){
				$cur = $newhist[$i];
				$envName = $cur[0];
				$envVal = $cur[1];
				//putenv("$envName=$envVal");
				echo $envName.': '.getenv($envName)."\n";
			}
			*/
			passthru('TOSLoader.exe > tmpoutput');
			$outputdata = file_get_contents('tmpoutput');
			if (strpos($outputdata, "http") !== false || strpos($outputdata, "PAN{") !== false){
				echo $outputdata."\n";
				for ($i=0; $i<count($newhist); $i++){
					$cur = $newhist[$i];
					$envName = $cur[0];
					$envVal = $cur[1];
					echo $envName.': '.getenv($envName)."\n";
				}
				die();
			}
		}
		else{
			$newhist = $hist;
			$newhist[] = array($val['id'], $val['lyrics']);
			traverseTree($val['children'], $newhist, $level+1);
		}
		
		putenv("$envName"); // remove the environment variable
	}
}
